Sezonun ilk sergisi, Sinan Logie ve Hayri Şengün’e ait. 40. yılın ilk sanatçı ikilisinin 22 Eylül – 21 Ekim 2023 tarihleri arasında gerçekleşecek olan “Hayri Logie - Sinan Şengün“ isimli sergisi, her iki sanatçının üretme pratiği ve malzemesini iç içe geçirdiği bir deneyim sunuyor. Sanatçılar, bu sergide anlam/anlamsızlık/gerçeklik üzerine bir arayışa gidiyor.
//

The first exhibition of the season is the exhibition of Sinan Logie and Hayri Şengün. The exhibition “Hayri Logie - Sinan Şengün” by the first artist duo of the 40th anniversary will present an experience in which the practice and material of both artists are intertwined, from September 22 to October 21, 2023. In this exhibition, the artists quest meaning/meaninglessness/reality.

